Blockly.Msg.TOUR1_DESCRIPTION00 = "Inainte";
Blockly.Msg.TOUR1_DESCRIPTION01 = "Bine ați venit,<br> faceți clic pe »următorul« și începeți un tur prin Open Roberta Lab. <br> Vă voi arăta cum vă puteți programa robotul cu NEPO. <br> Puteți încheia acest tur tot timpul cu un faceți clic pe »X« în colțul din dreapta sus.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "Meniul ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Aici puteți găsi tot ce aveți nevoie pentru a programa robotul! <br> <span class = 'typcn typcn-document-text \"> </span> Salvați și încărcați programele din <span class =\" typcn typcn-ev3 \"> </span> Conectați robotul la Open Roberta Lab sau treceți la un alt sistem <br> <span class = \"typcn typcn-lightbulb\"> </span> Ajutor pentru tot felul de probleme <br> <span class = \"typcn typcn-user \"> </span> Totul despre conturile de utilizator, de exemplu conectare sau deconectare <br> <span class =\" typcn typcn-th-large-outline \"> </span> Uită-te la galerie și încearcă programe grozave de la alți utilizatori! <br> <span class = \"typcn typcn-world\"> </span> Faceți clic aici pentru a comuta la o altă limbă";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Apasa aici pentru a trece inapoi la configurarea robotului";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Puteți adapta configurația robotului mai târziu, dacă ați construit un alt robot. <br> Dacă nu aveți un robot și doriți să vă testați programul în simulare, această configurație este aplicată.";
Blockly.Msg.TOUR1_DESCRIPTION06 = "Apasa aici pentru a trece inapoi la zona de programare!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "Cutia cu unelte. <br>Aici gasesti toate block-urile pentru programare.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "După ce sunteți un utilizator experimentat, puteți trece aici la modul expert al casetei de instrumente. <br> Veți găsi apoi mai multe blocuri pentru a vă programa robotul. <br> <span class = 'typcn typcn-media-stop-outline \"> </span> modul începător <br> <span class = \"typcn typcn-star-outline\"> </span> modul expert";
Blockly.Msg.TOUR1_DESCRIPTION08 = "Fiecare program începe cu blocul »program de pornire«. Blocurile de programare suplimentare pe care robotul ar trebui să le execute ar trebui să fie atașate la acest bloc. Nu trebuie decât să trageți blocul dorit chiar sub blocul de pornire.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Iată câteva scurtături!<br>De la stânga la dreapta:<br><span class='typcn typcn-media-play\"></span> Clic aici să rulezi programul pe un robot real<br><span class=\"typcn typcn-cloud-storage\"></span> Salvează programul. Înainte trebuie să te conectezi<br><span class=\"typcn typcn-zoom\"></span> Clic aici dacă dorești să faci zoom pe blocuri<br><span class=\"typcn typcn-archive\"></span> Coș de gunoi! Mută blocurile în coșul de gunoi și ele vor fi șterse<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Atenție: Nu poți recupera blocurile șterse!<br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "Da click pe Actiune";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Acum pune urmatorul block chiar sub blocul de incepere a programului ca sa fie conectate.";
